// ***********************************************
// This example commands.js shows you how to
// create various custom commands and overwrite
// existing commands.
//
// For more comprehensive examples of custom
// commands please read more here:
// https://on.cypress.io/custom-commands
// ***********************************************
//
//
// -- This is a parent command --
// Cypress.Commands.add("login", (email, password) => { ... })
//
//
// -- This is a child command --
// Cypress.Commands.add("drag", { prevSubject: 'element'}, (subject, options) => { ... })
//
//
// -- This is a dual command --
// Cypress.Commands.add("dismiss", { prevSubject: 'optional'}, (subject, options) => { ... })
//
//
// -- This is will overwrite an existing command --
// Cypress.Commands.overwrite("visit", (originalFn, url, options) => { ... })
import Board from "../../../src/components/Board.vue";

Cypress.Commands.add("resetBoard", (rows, cols, mines) => {
  cy.get("input[name='reset-rows']")
    .clear()
    .type(rows);
  cy.get("input[name='reset-cols']")
    .clear()
    .type(cols);
  cy.get("input[name='reset-mines']")
    .clear()
    .type(mines);
  cy.get(".reset-container button").click();
});

Cypress.Commands.add("mockBoard", (myRows, myCols, myMines) => {
  cy.log("Board => ");
  cy.log(Board);
  cy.stub(Board, "rows", () => 4);
  cy.stub(Board, "cols", () => 4);
  cy.stub(Board, "Mines", () => 4);

  // cy.stub(Board, "generateBoard", (rows, col, mines) => {
  //   Board
  // });
});
